Content-Type: text/css
Content-Transfer-Encoding: binary
Content-Location: https://jar-download.com/css/custom.css

@charset "utf-8";

.legal-notice-container { text-align: center; }

.align-center { text-align: center; }

.navbar { width: 100%; padding-right: 15px; }

.top-bar { text-align: center; }

body { padding-left: 0px; background: rgb(248, 248, 248); }

.panel { border-radius: 0px; box-shadow: rgb(148, 148, 148) 2px 2px 5px; border-color: rgb(148, 148, 148); }

.panel-heading { border-top-left-radius: 0px; border-top-right-radius: 0px; }

.panel-primary > .panel-heading { border-color: unset; }

.navbar { border-color: rgb(231, 231, 231); box-shadow: rgb(148, 148, 148) 2px 2px 5px; }

.logo-link { display: inline-block; margin-right: 10px; }

.content { max-width: 1024px; margin: 25px auto 0px; padding-left: 15px; padding-right: 15px; background: rgb(255, 255, 255); box-shadow: rgb(148, 148, 148) 2px 2px 5px; position: relative; }

#header-ad-wrapper { display: inline-block; vertical-align: bottom; }

@media only screen and (max-width: 760px) {
  #header-ad-wrapper { display: none; }
}

.panel-wrapper { min-width: auto; }

#logo { max-width: 200px; height: auto; }

.overflow-x { overflow-x: auto; }

#right-banner { width: 15%; height: 95%; position: fixed; right: 15px; top: 75px; }

#left-banner { left: 50px; position: fixed; top: 25px; width: 15%; height: 95%; }

.substitute-ad { display: none; }

@media only screen and (max-width: 1500px) {
  #left-banner { display: none; }
  #right-banner { display: none; }
}

@media only screen and (max-width: 1666px) {
  #left-banner { left: 0px; }
  #right-banner { right: 0px; }
  .substitute-ad { display: block; }
}

input[type="text"], input[type="password"], input[type="date"], input[type="datetime"], input[type="datetime-local"], input[type="month"], input[type="week"], input[type="email"], input[type="number"], input[type="search"], input[type="tel"], input[type="time"], input[type="url"], input[type="color"], textarea { appearance: none; border-radius: 0px; background-color: rgb(255, 255, 255); border-style: solid; border-width: 1px; border-color: rgb(204, 204, 204); box-shadow: rgba(0, 0, 0, 0.1) 0px 1px 2px inset; color: rgba(0, 0, 0, 0.75); display: block; font-family: inherit; margin: 0px 0px 1rem; padding: 0.5rem; width: 100%; box-sizing: border-box; transition: border-color 0.15s linear 0s, background 0.15s linear 0s; }

.btn { border-radius: 2px; }

.responsive-table-wrapper { overflow-x: auto; }

#save_btn { margin-bottom: 5px; }

#download-pom-btn { margin-bottom: 5px; }

.small-margin-bottom { margin-bottom: 3px; }

.ellipsis { overflow: hidden; white-space: nowrap; text-overflow: ellipsis; }

.sidebar-btn { max-width: 230px; text-align: left; }

.group-info { color: grey; }

.margin-bottom { margin-bottom: 5px; }

.autocomplete-wrapper { position: relative; }

.autocomplete { position: absolute; top: 35px; z-index: 999; padding: 5px; border-color: rgb(231, 231, 231); box-shadow: rgb(148, 148, 148) 2px 2px 5px; background-color: rgb(248, 248, 248); color: rgb(119, 119, 119); }

.autocomplete a { color: rgb(119, 119, 119); }

.block { display: block; }

.autocomplete-entry { padding: 3px; }

.autocomplete-entry:hover { background: rgb(173, 173, 173); }

.autocomplete-entry:hover a { color: rgb(255, 255, 255); }

.autocomplete-popular-groups { border-left: 1px solid rgb(221, 221, 221); margin-left: 10px; padding-left: 10px; vertical-align: top; }

.autocomplete a:hover { color: rgb(255, 255, 255); text-decoration: none; }

.my-project-btn a { text-shadow: rgba(0, 0, 0, 0.25) 0px -1px 0px; background-color: rgb(0, 0, 0); background-image: linear-gradient(red, rgb(0, 0, 0)); background-repeat: repeat-x; border-color: rgb(0, 0, 0); color: rgb(255, 255, 255) !important; }

.tab-content { padding: 3px; border-left: 1px solid rgb(221, 221, 221); border-right: 1px solid rgb(221, 221, 221); border-bottom: 1px solid rgb(221, 221, 221); }

.tab-content textarea { margin-bottom: 0px; white-space: nowrap; overflow-y: hidden; }

.build-tool-code > li > a { padding: 5px 15px; }

.new-info-box { font-size: 21px; }

.small-margin-top { margin-top: 3px; }

.mt15 { margin-top: 15px; }

.mr5 { margin-right: 5px; }

.middle-margin-top { margin-top: 6px; }

.no-margin-top { margin-top: 0px; }

.margin-top { margin-top: 5px; }

.rate-headline { margin: 0px; font-size: 14px; }

.rating-widget li { padding-right: 9px; font-size: 15px; }

.rating-widget { margin-bottom: 0px; }

.download-amount { font-size: 16px; }

.show-pom-btn { background: rgb(255, 228, 177); }

.search-btn i { margin-right: 0px; }

.project-price { font-size: 25px; font-weight: 700; }

.download-project-admin-btn { margin-bottom: 5px; }

.admin-bar { height: 75px; background: rgb(0, 0, 0); text-align: right; padding: 30px; }

#current-request-uri { color: rgb(255, 255, 255); margin-right: 10px; }

.maven-text-area { white-space: pre-wrap !important; }

#right-sidebar { position: absolute; left: 1030px; width: 250px; }

ul.breadcrumbs { padding: 0px; list-style: none; }

ul.breadcrumbs li { display: inline; font-size: 12px; }

ul.breadcrumbs li + li::before { padding: 8px; color: rgb(0, 0, 0); content: "/ "; }

ul.breadcrumbs li a { color: rgb(167, 167, 167); text-decoration: none; }

ul.breadcrumbs li a:hover { color: rgb(1, 68, 126); text-decoration: underline; }

.btn-default { background-color: rgb(245, 245, 245); }

.project-download-wrapper { display: inline-block; }

.project-actions-wrapper { display: flex; align-items: end; }

.project-actions-wrapper > * { margin-right: 5px; }

h1 { overflow: hidden; text-overflow: ellipsis; }

@media only screen and (max-width: 764px) {
  .container-fluid > .navbar-collapse, .container-fluid > .navbar-header, .container > .navbar-collapse, .container > .navbar-header { margin-left: 0px; padding-left: 15px; }
  .top-bar { display: none; }
  .content { margin-top: 0px; }
}

@media only screen and (max-width: 1555px) {
  #right-sidebar { display: none; }
}
